INSERT INTO `정보참고` VALUES (1,'User_info를 함부로 만지지 마세요!','User_info엔 sha로 암호화된 데이터가 있습니다. 알파벳 하나라도 hash값이 다르면 암호키가 달라져 정보를 열람할 수 없습니다. 주의하십시오.'),(2,'admin_account 비밀번호를 DB에서 함부로 만지지 마세요!','bcryptjs로 10번 암호화하여 sha256으로 저장되어 있습니다. 변경 시 관리자 페이지에서 직접 변경 부탁드립니다.'),(3,'ip정보는 비공개인가요?','네. ip정보는 중요한 개인정보 이므로 공개되어 있지 않습니다. //삭제되었습니다.'),(4,'free의 숫자를 변경해도 되나요?','아니요. 변경하지 마세요. 0이면 이미 제작된 틀에서 만들어진 정보이고 1이면 자유롭게 쓰는 방식으로 저장되어 있습니다.'),(5,'토큰값이 저장됩니다.','로그인 시 5일 동안 이용가능한 토큰값이 저장됩니다. 토큰 값을 삭제 하거나 토큰의 만료기간이 지나면 세션이 만료되어 다시 로그인해주셔야 합니다.'),(6,'쿠키도 저장되나요?','쿠키는 위변조의 위험이 있어 저장하지 않습니다. 다만 사용자 정보는 저장됩니다.'),(7,'로컬스토리지는 위험하지 않나요?','위험하지만 jwt는 무결성을 보장하기에 저장해도 안전합니다.');
